import React from 'react'

const Gallery = () => {
    return (
        <div>
            <img src='https://static.leica-camera.com/var/leica/storage/images/media/media-asset-management-mam/local-regional/gallerie/d%C3%BCsseldorf/gallery-dusseldorf-interior-1/4694765-1-eng-MA/Gallery-Dusseldorf-interior-1_teaser-480x320.png'/>
            <img src='https://dictionary.cambridge.org/ru/images/thumb/galler_noun_002_15326.jpg?version=5.0.102'/>
            <img src='https://static.dezeen.com/uploads/2020/02/200-amsterdam-elkus-manfredi-architects-news-skyscraper-new-york-city-usa_dezeen_2364_sq-300x300.jpg'/>
            <img src='https://dictionary.cambridge.org/ru/images/thumb/galler_noun_002_15326.jpg?version=5.0.102'/>
            <img src='https://dictionary.cambridge.org/ru/images/thumb/galler_noun_002_15326.jpg?version=5.0.102' width='100'/>
        </div>
    )
}

export default Gallery
